// SPDX-License-Identifier:MIT
pragma solidity ^0.8;

contract Test1{
    address public owner = msg.sender;
    function setOwner(address newOwner)public{
        require(msg.sender == owner,"cant not use this");
        owner = newOwner;
    }
}

contract Test2{

    address public owner  = msg.sender;
    uint public x;
    uint public y;
    uint public value;
    // payable 的意思是可以发送主bi'qu
    constructor(uint _x,uint _y) payable{
        x = _x;
        y = _y;
    }
}

contract Proxy{

}

